&lt;p&gt;&lt;strong&gt;Directions:&lt;/strong&gt; In the question a statement is given, followed by two arguments, I and II. You have to consider the statement to be true even if it seems to be at variance from commonly known facts. You have to decide which of the given arguments, if any, is a strong argument.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Statement:&lt;/strong&gt; Should street lights be switched off after midnight?&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Argument I:&lt;/strong&gt; No, statistics show that crime and accidents will increase if the street lights are switched off.&lt;br /&gt;
&lt;strong&gt;Argument II: &lt;/strong&gt;Yes, since fewer vehicles ply after midnight, expensive electricity will be wasted.&lt;/p&gt;

