&lt;p&gt;&lt;strong&gt;निर्देश:&lt;/strong&gt; निम्न प्रश्न में एक कथन और उसके बाद दो तर्क I और II दिए गये हैं। आपको दिए गये कथन को सत्य मानना है, भले ही वे ज्ञात तथ्यों से अलग प्रतीत होते हों। आपको तय करना है कि, निम्नलिखित तर्कों में से कौन-से तर्क, यदि कोई है, सबल तर्क है।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;कथन:&lt;/strong&gt; मध्यरात्रि के बाद स्ट्रीट लाइटें बंद कर दी जानी चाहिए?&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;तर्क I: &lt;/strong&gt;नहीं, आँकड़े बताते हैं कि यदि स्ट्रीट लाइटों को बंद कर दिया जाता है तो अपराध और दुर्घटनाएँ बढ़ जाती हैं।&lt;/p&gt;
&lt;strong&gt;तर्क II:&lt;/strong&gt; हाँ, चूँकि आधी रात के बाद कम वाहन चलेंगे, महंगी बिजली बर्बाद होगी।

